import {Routes,Route} from 'react-router-dom' 
import About from '../Components/pages/About'
const MyRoutes=()=>{
    return(
        <Routes>
            <Route path='/' element ={<About/>}/>
            <Route path='/store' element ={<About/>}/>
        </Routes>
    )
}
export default MyRoutes
